    false,nt"url": null,nt"notes": "This annual narrative for Roanoke River
    National Wildlife Refuge outlines Refuge accomplishments during the 2007 calendar
    year. The report begins with a forward, introduction, highlights, and a climatological
    review. The report discusses monitoring and studies, including surveys and censuses,
    and studies and investigations. The habitat restoration section of the report includes
    wetland restoration. Habitat management is also covered; subjects include management
    of water levels and soil units, and the control of pest plants. The fish and wildlife
    section of the report discusses bird banding, nest structure provision, and predator
    and exotics control. Coordination activities are included, such as interagency coordination,
    intra-agency coordination, private land activities, and cooperative/friends organizations.
    The resource protection section of the report discusses law enforcement, wildlife
    preparedness, management of permits and economic uses, and contaminant investigation
    and cleanup. Public education and recreation is outlined; information on visitor
    services and outreach is given. The planning and administration section of the report
    discusses general administration, and personnel.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
